import React from "react";
import styled from "styled-components";
import Danger from "../Assets/danger.png";

const Login = () => {
  return (
    <Container>
    
      <MainContent>
        <XPWindow>
          <TitleBar>üíæ Sobre</TitleBar>
          <Content>
            <h2>Hello Hello</h2>
            <p>
              auauauua
            </p>

            <h2>Sobre o Projeto</h2>
        
             efergeegerg
    
            <img src={Danger} alt="√≠cone de Alien" />
          </Content>
        </XPWindow>

        <SideContent>
          <XPWindow>
            <TitleBar>‚öôÔ∏è Tecnologias Usadas</TitleBar>
            <Content>
              <ul>
                <li>Node.js</li>
                <li>React</li>
                <li>Styled-components</li>
                <li>MySQL</li>
              </ul>
            </Content>
          </XPWindow>

          <XPWindow>
            <TitleBar>üìß Contato</TitleBar>
            <Content>
              <p>
                Sinta-se √† vontade para entrar em contato comigo pelo e-mail:{" "}
                <a href="mailto:jaiane.liv02@gmail.com">emailsupersecreto@gmail.com</a>
              </p>
            </Content>
          </XPWindow>
        </SideContent>
      </MainContent>
    </Container>
  );
};


const Container = styled.div`
  max-width: 1000px;
  margin: 40px auto;
`;


const MainContent = styled.div`
  display: flex;
  justify-content: space-between;
  gap: 20px; 
`;


const SideContent = styled.div`
  display: flex;
  flex-direction: column;
  gap: 20px; 
  width: 48%;
`;

const XPWindow = styled.div`
  max-width: 100%;
  margin: 20px 0;
  border: 2px solid #000;
  background-color: #e0e0e0;
  box-shadow: inset -2px -2px #fff, inset 2px 2px #808080;
  font-family: 'Press Start 2P', monospace;
`;

const TitleBar = styled.div`
  background-color: purple;
  color: white;
  padding: 10px;
  font-size: 20px;
  border-bottom: 2px solid #000;
`;

const Content = styled.div`
  padding: 20px;
  color: #000;

  h2 {
    margin-top: 20px;
    font-size: 18px;
  }

  p {
    font-size: 16px;
    line-height: 1.8;
    margin-top: 10px;
  }

  ul {
     font-family: 'Press Start 2P', monospace; 
    font-size: 16px;
    list-style-type: disc; 
    padding-left: 20px; 
  }

  a {
    color: purple;
    text-decoration: none;
  }

  a:hover {
    text-decoration: underline;
  }
`;

export default Login;
